import classes from "./DataDisplay.module.css";
import DataBar from "../DataBar/DataBar";
import React from "react";

function DataDisplay(props) {
  return (
    <div className={classes.div}>
      <div className={classes}>
        <DataBar />
      </div>
      {props.children}
    </div>
  );
}

export default DataDisplay;
